import React, { Component } from 'react';

import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Table from 'react-bootstrap/Table';

/*import { Document } from 'react-pdf';
import { pdfjs } from 'react-pdf';
import resume from '../../imgs/resume.pdf';
pdfjs.GlobalWorkerOptions.workerSrc = `//cdnjs.cloudflare.com/ajax/libs/pdf.js/${pdfjs.version}/pdf.worker.js`;
*/


class ExperienceContainer extends Component {
	render() {
		return (
			<Container>
				<Row>
					<Col>
						<h1 style={{textAlign:"center"}}>Technical Experience</h1>
					</Col>
				</Row>
				<hr />
				<Row>
					<Col style={{textAlign:"center"}}>
						<p>This page will outline and display various techical projects and experiences I have taken part in. You can also download my <a href="https://nigelhaney.me/imgs/resume.pdf">resume here.</a></p>
					</Col>
				</Row>
				<hr />
				<Row>
					<Col>
						<h2>Programming Languages</h2>
						<Table bordered>
							<thead>
								<tr>
									<th>Language</th>
									<th>Experiences With Language</th>
								</tr>
							</thead>
							<tbody>
								<tr>
									<td>Python</td>
									<td>I have taught this language, used extensively for both projects and competitive programming.</td>
								</tr>
								<tr>
								</tr>
							</tbody>
						</Table>
					</Col>
					<Col>

					</Col>
					<Col>

					</Col>
				</Row>
			</Container>
		);
	}
}

export default ExperienceContainer;
